import React from "react";

const AboutMe = () => (
  <div className="second-container">
    <h2>About Me</h2>
    <p>
      Welcome to my corner of the web! I'm Mandi Solone, a budding full stack
      web developer passionate about crafting functional and beautiful digital
      experiences...
    </p>
  </div>
);

export default AboutMe;
